import React from "react";
import { useState } from "react"
import './bottomNavigation.css';
import "@fontsource/red-hat-display";
import logo from './logo.svg';
import hamburger from './hamburger.svg';

import './min.css'
function BottomNavigation(){

    return(
        <div className="bottomNav">
            <div className="row">
                <div><div style={{'display':'flex','flex-direction':'row',}}><img src={logo} style={{width:'20%'}} /><p className="service-specific-text">Governance</p></div><p>Our vision is to help every digital dream come alive through a better and sustain security</p></div>
                <div className="box white-background text-center"><img src={logo} style={{width:'100%'}}/><p className="service-specific-text">UI/UX Prototype</p></div>
            </div>
        </div>
    );
}
/* Confederacie. */




export default BottomNavigation;
